import React from 'react';
import styled from 'styled-components';
import iconImage from './globe.svg'; // Update this with your icon image path

const Container = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

const Main = styled.main`
  background: rgba(165, 198, 237, 1);
  flex-grow: 1;
`;

const Icon = styled.img`
  width: 81px;
  position: absolute;
  top: 0;
  left: 0;
`;

function App() {
  return (
    <Container>
      <Header>
        {/* Your header content goes here */}
      </Header>
      <Main>
      </Main>
    </Container>
  );
}




const CommonTemplate = ({ children }) => {
  return (
    <Container>
      <Header>
        {/* Your header content goes here */}
      </Header>
      <Main>
        {children}
      </Main>
    </Container>
  );
};

export default App;
